--
-- Structure de la table `presentation`
--

CREATE TABLE `presentation` (
  `CodeCIP7` varchar(8) NOT NULL,
  `Libelle_presentation` varchar(255) DEFAULT NULL,
  `date_commercialisation` varchar(22) DEFAULT NULL,
  `Agrément_collectivités` varchar(23) DEFAULT NULL,
  `Taux_remboursement` varchar(18) DEFAULT NULL,
  `prix_min` varchar(8) DEFAULT NULL,
  `Prix_max` varchar(8) DEFAULT NULL,
  `difference_tarifiaire_entre_min_et_max` varchar(38) DEFAULT NULL,
  `CodeCIS` varchar(8) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

